import React,{useEffect, useState, useContext} from 'react'
import Axios from "axios"; 

export const Logger =  async (props) =>{
    
    function mapGetter(){
        Axios.get(`http://localhost:3001/api/bejelentkezes/${props.username}`).then((response) =>{
            let id = response.data[0].id
            let username = response.data[0].username
            let email = response.data[0].email
            let password = response.data[0].password 
            return{
                id:id,
                username:username,
                email:email,
                password:password
            };
        }); 
    }mapGetter();
   
};
